import React from 'react';

const Navbar = () => {
  return (
    <nav style={{ backgroundColor: 'teal', color: 'white', padding: '16px' }}>
      <a href="/" style={{ fontWeight: 'bold', fontSize: '16px' }}>
        Home
      </a>
    </nav>
  );
};

export default Navbar;
